#첫줄👋
.
2020.09.02(수) 스하네 일상🌞
.
아침에 스하 얼집 보내고는 허리 도수치료 냉큼 다녀와서 집에서 해먹기는 귀찮고 사먹기도 그렇고.. 그냥 스하 없는 동안 몰래 과자로 점심 🍿
전에 사둔 신상맛 과자들인데 난 둘 다 호🥰
.
동네 밴드 들어가보니 근처에 지금 백종원 아저씨 골목식당 촬영중이라고...📹
규현이랑 같이 다닌다던데 방송 나오면 또 사람들 몰리겠지...?🤔
.
엄마 허리 치료 받으러 간다는 이유로 긴급보육 보낸 스하는 역시나 잘 놀다왔다🙂
.
이제 대소변 가리는 시기라 쉬. 응가 에 대해서 놀이했다는데 이제 밤에 물도 덜 먹고 하는 걸 보니 스하도 슬슬 배변훈련 시기가 오려나...🤔
.
요즘 다시 집콕모드라 우울우울했는데 꽃 파신다는 동네분이 계셔서 한다발 샀는데 스하 얼집 데릴러 간 사이 도착!💐
오랜만에 꽃보니 기분좋당🥰
.
끼적이기 좋아하는 스하를 위해 색칠놀이를 샀는데... 음... 🤔
수성펜이라 색칠놀이 판도 잘 지워지긴 하지만.. 그만큼 몸에도 많이 묻어나고 무엇보다도 스하는 아직 주어진데 색칠하기는 어려운듯..🤔
.
저녁에 내 핸드폰으로 장난친다 싶더니 셀카타임🤳
.
스하의 셀카타임 2🤳
.
